const fs =require('fs')
var data = JSON.parse(fs.readFileSync("../config.json"))



export const getPasswordConfig = () => {
  print(data)
  const config = {
    minLength: 8,
    requireUppercase: true,
    requireLowercase: true,
    requireNumbers: true,
    requireSpecialChars: false,
  };

  return config;
};
